class NDT:

    def __init__(self, A, B, cellsize ,population, iterations, tolerance , odometry):
        self.A = A              #A = [[x, y, z], ...]
        self.B = B              #B = [[x, y, z], ...]
        self.N = iterations     #Number of runs
        self.E = tolerance      #feasible score
        self.C = max(cellsize,1)       #grid cell size
        self.P = population
        self.T = odometry  #odometry

        self.hashmap_A = defaultdict(list)

    def Distribute(self):
        '''
        Set cell size  

        Initializes hashmap A

        Implement a hash_map A  with keys as cell number        ###~~~~ TBD
        such that it contains at least 3 PointClouds


        '''
        for x, y, z in self.A:
            self.hashmap_A[f"{math.floor(x/self.C)},{math.floor(y/self.C)}"].append([x,y])
       
        xmean,ymean,sx,sy= 0,0,[],[]  
       
        '''

        Use the hash_map A and calculate mean and covariance within each cell
        and replace PointCloud values with it.

         for each cell in the hash_map A:

            a) Find mean(mu) of the PointClouds in it.

            b) Find the covariance(sigma) of the PointClouds in it.

            c) Find its  A[cell number] = (mu, sigma)

        '''
        self.grids = defaultdict(lambda :False)
        for k,v in self.hashmap_A.items():
            if len(v)>=self.P:

                for i in v:
                    sx.append(i[0])
                    sy.append(i[1])
                l = len(v)
                sx = np.array(sx)
                sy = np.array(sy)
                xmean = np.mean(sx)
                ymean = np.mean(sy)
                xsigma = (sx-xmean).dot(sx-xmean)/sx.size + 1e-7
                ysigma = (sy-ymean).dot(sy-ymean)/sy.size + 1e-7
                self.grids[k] = [[xmean, ymean, 0.] ,
                                 [1/xsigma, 1/ysigma, 0.]]
                sx = []
                sy = []
        return self


    def Pdf(self, mean, invcov, xy):
        '''
        score = e^(-(x-u) Σ^−1 (x-u).T/2)
        mean.shape == (3,)
        invcov.shape == (3,)
        xy.shape == (N, 3)

        '''
        self.invs  =  invcov*np.eye(3)

        self.diff = xy - mean                                 #(N,3)

        self.q_invs = -(self.diff).dot(self.invs)      #(N,3)

        self.q_invs_qt =   np.sum(np.multiply(self.q_invs, self.diff))    #(N,)
       
        self.summand = np.sum(np.exp(self.q_invs_qt/2))  #()
       
        return self
    def transform(self, tx, ty, m, xyz):
        '''

        T = |R t|.|x y z 1|.T
            |0 1|

        '''
        self.si = np.sin(m)
        self.co = np.cos(m)
        R = np.array([[self.co, -self.si,   0. ],
                      [self.si,  self.co,   0. ],      #input transform
                      [0.0    ,   0.0   ,   1.]])
        t = np.array([[tx], [ty], [0]])
       
        self.xyz = np.dot(R,xyz.T) + t
        return self


    def Jacobian(self, xy):
        '''

        JACOBIAN MATRIX: DERIVATIVE MATRIX; GRADIENT MATRIX
       
        In order to minimize the score; s = -score
        J = -∂s/∂pi = (x-u)t Σ^−1 ∂q/∂pi exp(−(x-u)t Σ^−1 (x-u)/2)

        where j = ∂q/∂pi
        and pi = (tx, ty, phi)T i = 1..3

        xy.shape    ==   (N, 3)
        self.q_invs ==   (N, 3)

        '''
        # self.j = np.array([[1,0, -x*self.si-y*self.co],
        #                    [0,1,  x*self.co-y*self.si]])  
        Rs = np.array([[-self.si, -self.co,   0. ],
                       [self.co,  -self.si,   0. ],      #input transform
                       [0.0    ,    0.0   ,   1.]])
       
        self.rs = np.dot(Rs, xy.T).T                                       #(3,N)=>(N,3)

        self.j = np.array([[[1., 0., i[0]],[0., 1., i[1]] ,[0., 0., 0.]] for i in self.rs])#(N, 3,3)
       
        self.q_invs_j = np.array([a.dot(b) for a,b in zip(self.q_invs, self.j)]) #(N,3)
       

        self.J = -self.q_invs_j.dot(self.summand) #(N,3)

        return self

    def Hessian(self, xy):
        '''
        HESSIAN MATRIX:  DOUBLE DERIVATVE MATRIX



        H = − e^(−qtΣ^−1q/2)(
            (−qtΣ^−1 ∂q/∂pi)(−qtΣ^−1 ∂q/∂pj)+
            (−qt Σ^−1 ∂2q/∂pi∂pj) +
            (−∂qt/∂pj Σ^−1 ∂q/∂pi))

        pi = (tx, ty, phi)T i = 1..3
        xy.shape    ==   (N, 3)
        deriv = (N,6)      []

        '''
        # o = np.array([[0.0],[0.0]])
        # dj = np.array([[-x*self.co + y*self.si], [-x*self.si - y*self.co]])
        # h = np.array([[  o, o, o ],
        #               [  o, o, o ],
        #               [  o, o, dj ]])
        # h = np.array([[-x*self.co + y*self.si],
        #               [-x*self.si - y*self.co]])
       

        Rss = np.array([[-self.co,   self.si,   0. ],
                        [-self.si,  -self.co,   0. ],      #input transform
                        [0.0    ,    0.0   ,    1.]])

        self.rss = np.dot(Rss, xy.T).T  #(3,N) =>(N,3)
       
        h = np.array([[[i[0]],[i[1]], [0.]] for i in self.rss])  #(N, 3,1)
       
        q_inv_ssq = np.sum(np.multiply(self.q_invs_j, self.q_invs_j),axis = 1)  #(N,)

        q_inv_h = np.array([a.dot(b) for a,b in zip(self.q_invs, h)])

        jt_inv_j =  np.array([i.T.dot(self.invs).dot(i) for i in self.j])
       
        #jt_inv_j = np.sum(np.multiply(np.multiply(self.j, self.invs), self.j), axis = 1)                          #(N,)
        #print(jt_inv_j.shape,'asd')

        self.H =np.eye(3)*1e-2 -self.summand*(np.array([a+b-c for a,b,c in zip(q_inv_ssq, q_inv_h, jt_inv_j)])) #(N,3,3)
       

        #print(self.q_invs.dot(h).shape)
        #print("----")
        return self

       

    def Score(self):
       
        t = []

        '''
        pk = (tx,ty,m).T  (An initial guess regarding the pose is given)

        pk+1 = pk - JH^-1

        '''
        grids = self.Distribute().grids
        for _ in range(self.N):
            score = 0.0
           
            self.B= self.transform(*self.T, self.B).xyz.T

            start = timeit.default_timer()
            '''
            xy = (3,)
            grids = (2,3)   [[xmean, ymean, 0.],[1/xsigma, 1/ysigma, 0.]]
            '''
            self.D = {}
            x,p = np.array([0.0, 0.0, 0.0]), 1 
            for key, xy in  map(lambda i:(b','.join(i[0][:-1]),i[1]),\
                zip(np.int8(np.floor(self.B/self.C)).astype("|S10"),self.B)):
                    k = key.decode('ascii')
                    if grids[k]:
                        d = grids[k]
                        score+= self.Pdf(d[0], d[1], xy).summand
                        x+=np.mean(list(map(lambda i:i[0].dot(i[1]), zip(self.Jacobian(xy).J,np.linalg.inv(self.Hessian(xy).H)))), axis = 0)
           
                 
            '''
            calculate score!!

            '''
        

            if score > self.E:
                return self.T

            else:
                 
                 self.T-=np.mean(x, axis = 0)
                 
        return self.T


